content:
The one we spotted was when deleting all children within a branch, i.e.:

```
case A (for ex, reth):
- Branch { None, A, B, C, None, ... }
- Branch { None, delete<A>, B, C, None, ... }
- Branch { None, None, reveal<B>, delete<C>, None, ... }
- B is deleted in a later op, but in its new position (either collapsed into an extension/leaf)

case B (for ex, geth):
- Branch { None, A, B, C, None, ... }
- Branch { None, delete<A>, B, C, None, ... }
- Branch { None, None, delete<B>, reveal<C>, None, ... }
- C is deleted in a later op, but in its new position (either collapsed into an extension/leaf)
```

Concrete example of this happening in the wild would be an account that had 3 storage slots:
* `0x00...0A`: 0x01
* `0x00...0B`: 0x02
* `0x00...0C`: 0x03
And a transaction sets each of these slots to `0`, returning the account trie to an empty state. Since deletion order is not standardized atm, the witness for applying these deletions to the trie is non-deterministic between clients (and for geth, non-deterministic alone before #30481).
